}
#searchbar:hover{

}
h3{
    margin:0;
    padding:0;
    opacity:.3;
    font-size:14px;
    color:black;
}
#products,#features,#formulation,#scoring,#historic{
    padding:10px 30px 20px 30px;
    box-shadow:inset rgba(0,0,0,.2) 5px 5px 15px;
    margin:2px 0 0 25%;
}
#formulation{
    background-color:orange;
    color:darkred;
